	static const wchar_t *table_IDS_ExportBusy[] = {L"DICOM transfer is in progress. Please wait for this transfer to finish.\nPress X to return to the application.\nPress Abort to stop the transfer (any snapshots or movies that are not yet transferred will be lost).", L"DICOM-overf\u00f8rsel er i gang. Vent p\u00e5, at denne overf\u00f8rsel fuldf\u00f8res.\nTryk p\u00e5 X for at vende tilbage til applikationen.\nTryk p\u00e5 Afbryd for at stoppe overf\u00f8rslen (eventuelle snapshots eller film, der endnu ikke er overf\u00f8rt, vil g\u00e5 tabt).", L"DICOM-\u00dcbertragung l\u00e4uft. Bitte warten, bis die \u00dcbertragung beendet wurde.\n\"X\" dr\u00fccken, um zur Anwendung zur\u00fcckzukehren.\n\"Abbrechen\" dr\u00fccken, um die \u00dcbertragung zu unterbrechen (Momentaufnahmen oder Filme, die noch nicht \u00fcbertragen wurden, gehen verloren).", L"La transferencia DICOM est\u00e1 en curso. Espere a que finalice la transferencia.\nPulse X para volver a la aplicaci\u00f3n.\nPulse Anular para detener la transferencia (se perder\u00e1n todas las instant\u00e1neas y pel\u00edculas que no se hayan transferido a\u00fan).", L"Transfert DICOM en cours. Veuillez patienter jusqu\'\u00e0 la fin du transfert.\nAppuyez sur X pour revenir \u00e0 l\'application.\nAppuyez sur Abandonner pour interrompre le transfert (les clich\u00e9s ou les films qui n\'ont pas encore \u00e9t\u00e9 transf\u00e9r\u00e9s seront perdus).", L"Trasferimento DICOM in corso. Attendere il completamento del trasferimento.\nPremere X per tornare all\'applicazione.\nPremere Interrompi per interrompere il trasferimento (eventuali istantanee o filmati non ancora trasferiti verranno persi).", L"DICOM-overdracht wordt uitgevoerd. Wacht tot de overdracht is voltooid.\nDruk op X om terug te keren naar de toepassing.\nDruk op Afbreken om de overdracht te stoppen (snapshots of filmpjes waarvan de overdracht nog niet is voltooid, worden verwijderd).", L"DICOM-overf\u00f8ringen er aktiv. Vent til den er fullf\u00f8rt.\nTrykk p\u00e5 X for \u00e5 g\u00e5 tilbake til applikasjonen.\nTrykk p\u00e5 Avbryt for \u00e5 stoppe overf\u00f8ringen (alle \u00f8yeblikksbilder eller filmer som ikke er overf\u00f8rt enda, vil g\u00e5 tapt).", L"DICOM-\u00f6verf\u00f6ring p\u00e5g\u00e5r. V\u00e4nta tills \u00f6verf\u00f6ringen har slutf\u00f6rts.\nTryck p\u00e5 X f\u00f6r att \u00e5terg\u00e5 till programmet.\nTryck p\u00e5 Avbryt f\u00f6r att stoppa \u00f6verf\u00f6ringen (eventuella snapshot och filmer som \u00e4nnu inte har \u00f6verf\u00f6rts f\u00f6rloras).", L"DICOM\u8ee2\u9001\u4e2d\u3067\u3059\u3002\u3053\u306e\u8ee2\u9001\u304c\u7d42\u4e86\u3059\u308b\u307e\u3067\u304a\u5f85\u3061\u304f\u3060\u3055\u3044\u3002\nX\u3092\u62bc\u3059\u3068\u30a2\u30d7\u30ea\u30b1\u30fc\u30b7\u30e7\u30f3\u306b\u623b\u308a\u307e\u3059\u3002\n\u300c\u4e2d\u65ad\u300d\u3092\u62bc\u3059\u3068\u8ee2\u9001\u304c\u505c\u6b62\u3057\u307e\u3059\uff08\u8ee2\u9001\u304c\u6e08\u3093\u3067\u3044\u306a\u3044\u30b9\u30ca\u30c3\u30d7\u30b7\u30e7\u30c3\u30c8\u3084\u30e0\u30fc\u30d3\u30fc\u306f\u5931\u308f\u308c\u307e\u3059\uff09\u3002", L"DICOM \u4f20\u8f93\u6b63\u5728\u8fdb\u884c\u4e2d\u3002\u8bf7\u7b49\u5f85\u6b64\u4f20\u8f93\u5b8c\u6210\u3002\n\u6309\u4e0b X \u8fd4\u56de\u81f3\u5e94\u7528\u7a0b\u5e8f\u3002\n\u6309\u4e0b\u4e2d\u6b62\u505c\u6b62\u4f20\u8f93\uff08\u4efb\u4f55\u5c1a\u672a\u4f20\u8f93\u7684\u5c4f\u5e55\u5feb\u7167\u6216\u7535\u5f71\u5c06\u4e22\u5931\uff09\u3002", L"DICOM \u50b3\u8f38\u9032\u884c\u4e2d\u3002\u8acb\u7b49\u5f85\u6b64\u50b3\u8f38\u5b8c\u6210\u3002\n\u6309\u4e0b X \u4ee5\u9000\u56de\u81f3\u61c9\u7528\u7a0b\u5f0f\u3002\n\u6309\u4e0b\u300c\u4e2d\u6b62\u300d\u4ee5\u505c\u6b62\u50b3\u8f38 (\u4efb\u4f55\u5c1a\u672a\u50b3\u8f38\u7684\u5feb\u7167\u6216\u5f71\u7247\u5c07\u6703\u907a\u5931)\u3002", L""}; IDS_ExportBusy = table_IDS_ExportBusy[int(lang)];
