	static const wchar_t *table_IDS_LegalMedicalDevice[] = {L"This Medical Device meets the provisions of the transposition of the Medical Device Directive 93/42/EEC within the country of origin of the Notified Body concerned with the device.", L"Dette medicinske udstyr lever op til bestemmelserne i henhold til gennemf\u00f8relsen af R\u00e5dets direktiv om medicinsk udstyr 93/42/E\u00d8F i oprindelseslandet for det bemyndigede organ, udstyret falder under.", L"Dieses Medizinprodukt erf\u00fcllt die Anforderungen zur Umsetzung d. Richtlinie 93/42/EWG \u00fcber Medizinprodukte innerhalb des Ursprungslands der f\u00fcr das Medizinprodukt zust\u00e4ndigen benannten Stelle.", L"Este dispositivo m\u00e9dico cumple las disposiciones sobre transporte de la Directiva sobre productos sanitarios 93/42/CEE dentro del pa\u00eds de origen del organismo notificado al que concierne el dispositivo.", L"Cet appareil m\u00e9dical est conforme aux dispositions de la Directive\u00a093/42/CEE, relative aux dispositifs m\u00e9dicaux, telles que transpos\u00e9es dans l\'Etat-membre d\'origine de l\'organisme notifi\u00e9 concern\u00e9 par ce dispositif.", L"Il presente dispositivo medico \u00e8 conforme alle disposizioni contenute nella trasposizione della Direttiva sui dispositivi medici 93/42/CEE nel Paese di origine dell\'organismo competente per il dispositivo in oggetto.", L"Dit medische apparaat voldoet aan de bepalingen van de richtlijn voor medische apparaten 93/42/EEG in het land van oorsprong van de aangemelde instantie voor het testen van het apparaat.", L"Dette medisinske utstyret f\u00f8lger bestemmelsene i implementeringen av direktiv 93/42/E\u00d8F om medisinsk utstyr i opprinnelseslandet til det organet som har myndighet til \u00e5 ta seg av utstyret.", L"Den h\u00e4r medicinska enheten uppfyller villkoren i den lokala versionen av direktivet om medicintekniska produkter 93/42/EEG i ursprungslandet f\u00f6r det godk\u00e4nda anm\u00e4lda organet f\u00f6r den ber\u00f6rda enheten.", L"\u672c\u533b\u7528\u6a5f\u5668\u306f\u3001\u5f53\u8a72\u6a5f\u5668\u306b\u95a2\u4e0e\u3059\u308b\u516c\u8a8d\u6a5f\u95a2\u306e\u6240\u5728\u56fd\u5185\u306b\u304a\u3051\u308b\u533b\u7642\u6a5f\u5668\u6307\u4ee493/42/EEC\u306b\u4ee3\u308f\u308b\u898f\u5b9a\u306b\u9069\u5408\u3057\u3066\u3044\u307e\u3059\u3002", L"\u672c\u533b\u7597\u8bbe\u5907\u5728\u8bbe\u5907\u76f8\u5173\u516c\u544a\u673a\u6784\u7684\u539f\u4ea7\u56fd\u5185\u7b26\u5408\u533b\u7597\u5668\u68b0\u6307\u4ee4 93/42/EEC \u7684\u8fd0\u8f93\u6cd5\u89c4\u3002", L"\u6b64\u91ab\u7642\u88dd\u7f6e\u7b26\u5408\u539f\u7522\u570b\u5167\u8207\u88dd\u7f6e\u6709\u95dc\u7684\u516c\u544a\u6a5f\u69cb\u4e4b\u91ab\u7642\u88dd\u7f6e\u6307\u4ee4 93/42/EEC \u7684\u8f49\u63db\u689d\u6b3e\u3002", L""}; IDS_LegalMedicalDevice = table_IDS_LegalMedicalDevice[int(lang)];
