	static const wchar_t *table_IDS_CoronaryToolsHasStoppedWorkingFull[] = {L"Coronary tools has stopped working and a problem report has been created.\n\nPlease try the following steps to attempt to recover the Coronary tools:\n1. Press Retry to restart the Coronary tools\n2. Perform a warm restart of the X-ray system\n3. Call service\n\n(Press Cancel to enter Philips SupportConnect)", L"Coronary Tools er holdt op med at virke, og en problemrapport er blevet oprettet.\n\nPr\u00f8v f\u00f8lgende trin til at fors\u00f8ge at  genoprette Coronary Tools:\n1. Tryk p\u00e5 Pr\u00f8v igen for at genstarte Coronary Tools\n2. Udf\u00f8r en varm genstart af r\u00f8ntgensystemet\n3. Tilkald service\n\n(Tryk p\u00e5 Annuller for at f\u00e5 adgang til Philips SupportConnect)", L"Coronary Tools arbeiten nicht mehr. Es wurde ein Problembericht erstellt.\n\nBitte versuchen Sie, die Coronary Tools mithilfe der folgenden Schritte wiederherzustellen:\n1. Zum Neustart der Coronary Tools \"Erneut versuchen\" dr\u00fccken\n2. Einen Warmstart des R\u00f6ntgensystems durchf\u00fchren\n3. Den Kundendienst kontaktieren\n\n(\"Abbrechen\" dr\u00fccken, um in das Men\u00fc \"Philips SupportConnect\" zu gelangen)", L"Coronary Tools ha dejado de funcionar y se ha creado un informe con el problema.\n\nPruebe los pasos siguientes para intentar recuperar Coronary Tools:\n1. Pulse Reintentar para reiniciar Coronary Tools\n2. Realice un reinicio flexible del sistema de rayos X\n3. Llame al servicio t\u00e9cnico\n\n(Pulse Cancelar para especificar Philips SupportConnect)", L"Coronary Tools a cess\u00e9 de fonctionner et un rapport de probl\u00e8me a \u00e9t\u00e9 cr\u00e9\u00e9.\n\nVeuillez effectuer les actions suivantes pour essayer de r\u00e9cup\u00e9rer Coronary tools :\n1. Appuyez sur R\u00e9essayer pour red\u00e9marrer Coronary tools\n2. Effectuez un red\u00e9marrage \u00e0 chaud du syst\u00e8me de radiologie\n3. Appelez le SAV\n\n(Appuyez sur Annuler pour acc\u00e9der \u00e0 Philips SupportConnect)", L"Coronary Tools ha smesso di funzionare ed \u00e8 stato creato un report relativo al problema.\n\nPer ripristinare Coronary Tools, attenersi alla seguente procedura:\n1. Premere Riprova per riavviare Coronary Tools\n2. Eseguire un riavvio a caldo del sistema radiologico\n3. Contattare l\u2019assistenza\n\n(Premere Annulla per accedere a Philips SupportConnect)", L"Coronaire hulpmiddelen zijn gestopt met werken en er is een foutrapport gemaakt.\n\nProbeer het volgende om Coronaire hulpmiddelen te herstellen:\n1. Start Coronaire hulpmiddelen opnieuw op\n2. Start het r\u00f6ntgensysteem opnieuw op\n3. Neem contact op met het serviceteam\n\n(Klik op Annuleren voor Philips SupportConnect)", L"Coronary Tools har sluttet \u00e5 virke, og en problemrapport har blitt opprettet.\n\nUtf\u00f8r f\u00f8lgende trinn for \u00e5 pr\u00f8ve \u00e5 gjenopprette Coronary Tools:\n1. Trykk p\u00e5 Pr\u00f8v igjen for \u00e5 starte Coronary Tools p\u00e5 nytt\n2. Utf\u00f8r en varm omstart av r\u00f8ntgensystemet\n3. Ring service\n\n(Trykk p\u00e5 Avbryt for \u00e5 g\u00e5 inn i Philips SupportConnect)", L"Coronary Tools har slutat fungera och en problemrapport har skapats.\n\nF\u00f6rs\u00f6k med f\u00f6ljande steg f\u00f6r att \u00e5terst\u00e4lla Coronary Tools:\n1. Tryck p\u00e5 F\u00f6rs\u00f6k igen f\u00f6r att starta om Coronary Tools\n2. Utf\u00f6r en varm omstart av r\u00f6ntgensystemet\n3. Ring till service\n\n(Tryck p\u00e5 Avbryt f\u00f6r att \u00f6ppna Philips SupportConnect)", L"Coronary Tools\u304c\u52d5\u4f5c\u3092\u505c\u6b62\u3057\u3001\u554f\u984c\u30ec\u30dd\u30fc\u30c8\u304c\u4f5c\u6210\u3055\u308c\u307e\u3057\u305f\u3002\n\n\u6b21\u306e\u624b\u9806\u3092\u5b9f\u884c\u3057\u3066Coronary Tools\u306e\u5fa9\u65e7\u3092\u8a66\u307f\u3066\u304f\u3060\u3055\u3044\u3002\n1. \u300c\u518d\u8a66\u884c\u300d\u3092\u62bc\u3057\u3066Coronary Tools\u3092\u518d\u8d77\u52d5\u3057\u307e\u3059\n2. X\u7dda\u30b7\u30b9\u30c6\u30e0\u306e\u30a6\u30a9\u30fc\u30e0\u30ea\u30b9\u30bf\u30fc\u30c8\u3092\u5b9f\u884c\u3057\u307e\u3059\n3. \u30b5\u30fc\u30d3\u30b9\u62c5\u5f53\u8005\u306b\u554f\u3044\u5408\u308f\u305b\u307e\u3059\n\n(\u300c\u30ad\u30e3\u30f3\u30bb\u30eb\u300d\u3092\u62bc\u3059\u3068Philips SupportConnect\u6a5f\u80fd\u4ed8\u304d\u306e\u30e1\u30cb\u30e5\u30fc\u304c\u8868\u793a\u3055\u308c\u307e\u3059)", L"Coronary Tools \u5df2\u505c\u6b62\u5de5\u4f5c\uff0c\u5e76\u5df2\u521b\u5efa\u95ee\u9898\u62a5\u544a\u3002\n\n\u8bf7\u5c1d\u8bd5\u4ee5\u4e0b\u6b65\u9aa4\u4ee5\u5c1d\u8bd5\u6062\u590d\u51a0\u72b6\u52a8\u8109\u5de5\u5177\uff1a\n1. \u6309\u4e0b\u201c\u91cd\u8bd5\u201d\u4ee5\u91cd\u542f\u51a0\u72b6\u52a8\u8109\u5de5\u5177\n2. \u6267\u884c X \u5c04\u7ebf\u7cfb\u7edf\u70ed\u91cd\u542f\n3. \u8054\u7cfb\u670d\u52a1\n\n\uff08\u6309\u4e0b\u201c\u53d6\u6d88\u201d\u4ee5\u8fdb\u5165 Philips SupportConnect\uff09", L"Coronary Tools \u5df2\u505c\u6b62\u904b\u4f5c\u4e26\u5df2\u5efa\u7acb\u554f\u984c\u5831\u544a\u3002\n\n\u8acb\u5617\u8a66\u4e0b\u5217\u6b65\u9a5f\u4ee5\u8a66\u5716\u6062\u5fa9 Coronary Tools\uff1a\n1. \u6309\u4e0b\u91cd\u8a66\u4ee5\u91cd\u65b0\u555f\u52d5 Coronary Tools\n2. \u57f7\u884c X \u5149\u7cfb\u7d71\u6696\u91cd\u958b\n3. \u806f\u7d61\u5ba2\u670d\n\n(\u6309\u4e0b\u300c\u53d6\u6d88\u300d\u4ee5\u9032\u5165 Philips SupportConnect)", L""}; IDS_CoronaryToolsHasStoppedWorkingFull = table_IDS_CoronaryToolsHasStoppedWorkingFull[int(lang)];
